import { useState, useEffect } from "react";
import { createClient } from "@supabase/supabase-js";
import PhotoCard from "../components/photoCard";
import { Grid } from "@mui/material";

const supabaseUrl = "https://uxcdfactbubyfmlvtyas.supabase.co";
const supabaseKey =
	"eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6InV4Y2RmYWN0YnVieWZtbHZ0eWFzIiwicm9sZSI6ImFub24iLCJpYXQiOjE3MjQyMzgyMzAsImV4cCI6MjAzOTgxNDIzMH0.URl7arzfpXfrgNv8tGO_qU25c8WXLHnlY5NWyAL9gxs";
const supabase = createClient(supabaseUrl, supabaseKey);

const Photography = () => {
	const [images, setImages] = useState([]);

	useEffect(() => {
		const fetchImages = async () => {
			const { data, error } = await supabase.storage
				.from("Photography") // Replace with your bucket name
				.list("", { limit: 100 }); // Adjust the path and limit as needed

			if (error) {
				console.error("Error fetching images:", error);
			} else {
				const imageObjects = data.map((file) => ({
					title: file.name,
					url: supabase.storage.from("Photography").getPublicUrl(file.name)
						.publicUrl,
				}));
				setImages(imageObjects);
			}
		};

		fetchImages();
	}, []);

	return (
		<Grid container>
			{images.map((image) => (
				<Grid item xs={12} md={4} key={image.title}>
					<PhotoCard image={image} />
				</Grid>
			))}
		</Grid>
	);
};

export default Photography;
